import React from 'react';

const SuccessPage = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-br from-blue-500 to-green-400 text-white">
      <div className="text-center">
        {/* Success Icon */}
        <div className="bg-white rounded-full p-4 mb-6">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            className="h-16 w-16 text-green-500"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
          >
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 13l4 4L19 7" />
          </svg>
        </div>
        {/* Success Text */}
        <h1 className="text-4xl font-bold mb-4">Thank You!</h1>
        <p className="text-lg mb-6">Your order has been successfully placed.</p>
        {/* Button */}
        <a
          href="/"
          className="px-6 py-3 bg-white text-blue-600 font-bold rounded shadow hover:bg-blue-100 transition duration-300"
        >
          Back to Home
        </a>
      </div>
    </div>
  );
};

export default SuccessPage;
